import React from "react"

import Carousel from "../components/Parallax"
import data from "../data"

function Carousels() {
    console.log(data)
    return(
        <>
            {data.map(item => {
                <Carousel key={item.id} object={item}/>
            })}
        </>
    )
}

export default Carousels
